import React, { useEffect } from "react";
import { connect } from "react-redux";
import { loadUser } from "../../actions/auth";

const Home = ({ loadUser }) => {
  useEffect(() => {
    loadUser();
    // eslint-disable-next-line
  }, []);

  return <div>Home</div>;
};

export default connect(
  null,
  { loadUser }
)(Home);
